/**
 * @param {number[]} nums
 * @param {number} k
 * @return {number}
 */
var maximumScore = function (nums, k) {
  let max = 0;
  // let prevMin;
  for (let i = 0; i < nums.length; i++) {
    if (i >= 1 && nums[i] < nums[i - 1]) {
      // console.log('skip');
      continue;
    }
    let min = Infinity;
    for (let j = i; j < nums.length; j++) {
      // console.log('TCL ~ min', min);
      if (nums[j] < min) min = nums[j];
      const score = min * (j - i + 1);
      if (score > max && i <= k && k <= j) {
        max = score;
      }
    }
    // prevMin = min;
  }
  return max;
};

